import React from 'react';

export default () => (
  <svg width="1em" height="1em" viewBox="0 0 16 16" version="1.1">
    <g stroke="none" strokeWidth="1" fill="none" fillRule="evenodd">
      <line x1="4" y1="8" x2="12" y2="8" id="Path-11" stroke="currentColor" strokeWidth="1.5" />
      <line x1="8" y1="4" x2="8" y2="12" id="Path-12" stroke="currentColor" strokeWidth="1.5" />
      <circle stroke="currentColor" cx="8" cy="8" r="7.5" />
    </g>
  </svg>
);
